let freshGcodes = true
const updatingPrinter = noopObj({
	fileMeta: () => fileMeta,
	listGcodes: () => {
		freshGcodes = !freshGcodes

		if (freshGcodes) {
			return [
				{
					...gcodes[0],
					modified: new Date().getTime() / 1000,
					size: 8198190,
				},
				...gcodes.slice(1),
			]
		}

		return gcodes
	},
	subscribeGcodesUpdates: (callback: () => void) => {
		const interval = setInterval(() => {
			callback()
		}, 2000)

		return () => {
			clearInterval(interval)
		}
	},
}) as Moonraker

